"function (so) {
    var key = rog.getRandomKey(so); 
    var value = rog.randomReplaceWith(
        rog.getPropValue(so, key),
        rog.getRandomMakeDataFn()(),
        0.5
        );
    var obj = rog.makeObjectFromDotKeys(key, value); 
    return obj;  
    }"

